import React, { useState } from 'react';
import { Button, Modal, Input } from 'antd';
import 'antd/dist/reset.css';
import "./Recuperar2.css";

export const Recuperar2 = ({ isVisible }) => {

  const handleCancel = () => {
    setIsModalVisible(false);
  };

  const [isModalVisible, setIsModalVisible] = React.useState(isVisible);

  return (
    <>
      <Modal
        title="Recuperar Contraseña"
        centered
        open={isModalVisible}
        onCancel={handleCancel}
        footer={null}
        className='modal_recuperar1'
        data-dismiss="modal"
        maskClosable={false}
      >
        <div className="div">
          <p className='text'>Ingrese el correo o código del proyecto</p>
        </div>

        <Input className='input'></Input>
        <Button className='boton_enviar'>Enviar Código</Button>
      </Modal>
    </>
  );
};

export default Recuperar2;
